import React, { useEffect, useState } from "react";
import './districtzone.css'

const DistrictZoneGraph = (props) => {
  const [stateCode, setStateCode] = useState('')
  console.log(props.zoneData)
  useEffect(() => {
    setStateCode(props.stateCode)

  })

  return (
    <div className="zones-data">
      <div className="row zone-col">
        {props.stateCode === stateCode &&
          <div className=" red lighten-4 zone">
            {props.zoneData.map(dist => (
              dist.zone === 'Red' && <p> {dist.district} </p>
            ))}
          </div>
        }
        {/* <div className=" orange lighten-4 zone">
        {orangeZone.map(dist => (
            <p>{dist}</p>
          ))}
        </div>
        <div className=" green lighten-4 zone">
        {greenZone.map(dist => (
            <p>{dist}</p>
          ))}
        </div> */}
      </div>
    </div>
  )
}

export default DistrictZoneGraph
